article_content:
아눀ㅋㅋㅋㅋㅋ다 깨진거 보내면 어쩌란거죠;
하나는 이해햇는데 귀찮아서;
근데 두개다 깨졌네요

화요일에 배송받아 베란다에 두고 시간날때 정리한다고 상품 개봉했을때 겹쳐 있던 두껑두개중 하나가 깨져 있었어요
두껑 배송 문의드렸지만 답변없으시네요^^;;
생각보다 많은양이 안들어가요 ㅜㅜ
기존55L통에서 그대로 꺼내 담았는데 넘쳐서 두껑이 제대로 닫히지도 않네요 --;;

깨져서왔어요 안깨진다더니 택배운반으론 깨지나바여;
포장도 다 뜯어버리고 급한대로 써야해서 걍 쓰네요
일단 수납은 엄청 들어가요 가격대비 좋아요
